import React, { useState } from "react";
import "./Navbar.css";
import { FiMenu, FiX } from "react-icons/fi";
import CompleteLogo from "../../Images/LogoPaqariTransparente.png";
import {Link} from "react-scroll";

const Navbar = ({ navbarLinks }) => {
  // Determines if the "menu icon" was clicked or not. Note that this icon is only visible when the window width is small.
  const [menuClicked, setMenuClicked] = useState(false);

  const toggleMenuClick = () => {
    setMenuClicked(!menuClicked);
  };

  return (
    <nav className="navbar">
      <div className="navbar__logo">
        <img alt="CompeteLogo" src={CompleteLogo}/>
      </div>

      {menuClicked ? (
        <FiX size={25} className={"navbar__menu"} onClick={toggleMenuClick} />
      ) : (
        <FiMenu
          size={25}
          className={"navbar__menu"}
          onClick={toggleMenuClick}
        />
      )}
      <ul
        className={
          menuClicked ? "navbar__list navbar__list--active" : "navbar__list"
        }
      >
        {navbarLinks.map((item, index) => {
          return (
            <li className="navbar__item" key={index}>
              <Link activeClass="active" to={item.url} spy={true} smooth={true} offset={50} duration={1000} className="navbar__link" >
                {item.title}
              </Link>
            </li>
          );
        })}
      </ul>
      <div className="en-es">
        <h2>Hola</h2>
      </div>
    </nav>
  );
};

export default Navbar;
